  false,\n\t\"url\": null,\n\t\"notes\": \"Managed_Lands_IDNR_IN is a polygon shapefile
  that contains managed land areas in Indiana, provided by personnel of the Indiana
  Natural Heritage Data Center, Indiana Department of Natural Resources (INHDC-IDNR)
  as of November 8, 2013. Attributes include contact information for land managers,
  as well as whether the land is open to the general public or if access is restricted.
  For additional information regarding lands owned by federal agencies, local agencies,
  and non-profit organizations, as well as conservation easements, persons should
  contact the IDNR Indiana Natural Heritage Data Center (317-232-4052). The following
  is excerpted from the metadata provided by INHDC-IDNR for the source shapefile MANAGEDLANDS_DNR_INHD_IN_131016.SHP:
  \"ManagedLands_DNR_INHD_IN is a subset of ManagedLandsAll_DNR_INHD_IN, excluding
  those areas that are listed as conservation easements or listed as closed. \"ManagedLandsAll_DNR
  is the Indiana Natural Heritage Data Center Managed Areas dataset. It includes natural
  and recreation areas which are owned or managed by the Indiana Department of Natural
  Resources, federal agencies, local agencies, and non-profit organizations. It also
  includes private lands with Conservation Easements owned by IDNR. \"NATURAL AREAS
  THAT ARE NOT OWNED NOR MANAGED BY DNR ARE ADDED AS DATA IS AVAILABLE. IT IS BY NO
  MEANS A COMPLETE AND COMPREHENSIVE DATASET FOR ALL SUCH AREAS IN THE STATE. \"The
  Indiana Natural Heritage Data Center Managed Area Database is a digital, geospatial
  file containing information on Indiana's significant protected natural areas. All
  counties in the state are represented.\"\",\n\t\"license_title\": null,\n\t\"extras\":
